import { FileList } from "../types/types";


const API_URL = process.env.REACT_APP_API_URL;


export const fetchFileList = async (pathType: string): Promise<FileList> => {
  try {
      const response = await fetch(`${API_URL}/file-list?pathType=${pathType}`);
      return await response.json();
  } catch (error) {
      console.log(error);
      throw error;
  }
};
